import "./datatable.scss";
import { DataGrid } from "@mui/x-data-grid";
import { userColumns, userRows } from "../../../datatablesource";
import { Link, useNavigate } from "react-router-dom";
import { useEffect, useState } from "react";
import useFetch from "../../../hooks/useFetch";
import axios from "axios";
import Swal from "sweetalert2";
import UpdateJobForm from "../updateJobForm/UpdateJobForm";
import jsPDF from "jspdf";
import "jspdf-autotable";

const Datatable = () => {
  const [list, setList] = useState([]);
  const [filterData, setFilterData] = useState([]);
  const [query, setQuery] = useState("");
  const [updateID, setUpdateID] = useState("");
  const { data, loading, error } = useFetch("/jobs");
  const navigate = useNavigate();

  useEffect(() => {
    setList(data);
    setFilterData(data);
  }, [data]);

  const handleDelete = async (id) => {
    try {
      Swal.fire({
        title: "Are you sure?",
        text: "You won't be able to revert this!",
        icon: "warning",
        showCancelButton: true,
        confirmButtonColor: "#10A19D",
        cancelButtonColor: "#d33",
        confirmButtonText: "Yes, delete it!",
      }).then((result) => {
        if (result.isConfirmed) {
          axios.delete(`/jobs/${id}`);
          setList(list.filter((item) => item._id !== id));
          console.log(`${id}`);
          Swal.fire("Deleted!", "Your job has been deleted.", "success");
        }
      });
    } catch (err) {}
  };

  // const handleUpdate = async (id) => {
  //   <UpdateJobForm></UpdateJobForm>;
  //   console.log(id);
  // };

  const handleSearch = (event) => {
    const getSearch = event.target.value;
    setQuery(getSearch);

    if (getSearch.length > 0) {
      const searchData = list.filter((item) =>
        item.employeeId.toLowerCase().includes(getSearch)
      );
      setList(searchData);
    } else {
      setList(filterData);
    }
  };

  const actionColumn = [
    {
      field: "action",
      headerName: "Action",
      width: 150,
      renderCell: (params) => {
        return (
          <div className="cellAction">
            {/* <div
              className="updateButton"
              onClick={() => {
                //handleUpdate(params.row._id);
                navigate(`/housekeeping/updateJob?id=${params.row._id}`);
              }}
            >
              Update
            </div> */}
            <Link
              className="updateButton"
              type="button"
              to={`/housekeeping/updateJob/${params.row._id}`}
            >
              Update
            </Link>
            <div
              className="deleteButton"
              onClick={() => handleDelete(params.row._id)}
            >
              Delete
            </div>
          </div>
        );
      },
    },
  ];

  const downloadPdf = () => {
    const doc = new jsPDF("l", "", "a4");
    const imageData =
      "data:image/png;base64,";
    doc.setFontSize(23);
    doc.text("Hotel Silver Sands\n", 15, 15);
    doc.text("-------------------------", 15, 19);
    doc.setFontSize(12);
    doc.text(
      "\nNegombo\nTel: 0112952401\nEmail: hotelsilversands@gmail.com",
      15,
      17
    );
    doc.setFontSize(16);
    doc.text("DUTY ROSTER", 130, 45);
    doc.addImage(imageData, "PNG", 255, 5, 30, 30);
    doc.autoTable({
      theme: "grid",
      head: [
        [
          "Job Title",
          "Employee ID",
          "Location",
          "Date",
          "Working Shift",
          "Remarks",
        ],
      ],
      body: list.map((item) => [
        item.jobTitle,
        item.employeeId,
        item.location,
        item.date,
        item.workingShift,
        item.jobDesc,
      ]),
      margin: { top: 50 },
    });
    doc.save("Duty Roster.pdf");
  };

  const actions = [
    {
      icon: () => (
        <button onClick={downloadPdf} className="export">
          Export as PDF
        </button>
      ),
      tooltip: "Export to Pdf",
      isFreeAction: true,
    },
  ];

  return (
    <div className="datatable">
      <div className="datatableTitle">
        DUTY ROSTER
        <Link to="/housekeeping/assignJob" className="link">
          Assign New Job
        </Link>
      </div>
      <input
        type="text"
        value={query}
        className="search"
        onChange={(e) => handleSearch(e)}
        placeholder="Search by Employee ID"
      />
      <DataGrid
        className="datagrid"
        rows={list}
        columns={userColumns.concat(actionColumn)}
        pageSize={8}
        rowsPerPageOptions={[8]}
        checkboxSelection
        getRowId={(row) => row._id}
        components={{
          Toolbar: () => (
            <div>
              {actions.map((action, index) => (
                <action.icon key={index} onClick={action.onClick} />
              ))}
            </div>
          ),
        }}
      />
    </div>
  );
};

export default Datatable;
